            username: 'sikchi_123',
            password: 'sikchi_456',
            email: 'sagar.sikchi@mail.com',
            isIncomeRegular: true,
            incomeAmount: 40000,
            incomePeriod: 'monthly',
        }
    }

    render() {
        return <div className = "container">
            <NavBar 
                profile = ''
                makePlan = ''
                settings = ' active'
